import React from 'react';
import Post from './Post/Post';
import styles from './posts.module.css';

const Posts = () => {

    let postsData = [
        { id: 1, name: 'Anar', text: 'Hi', likesCount: '0'  },
        { id: 2, name: 'Anar', text: 'Vova', likesCount: '0' },
        { id: 3, name: 'Anar', text: '1337', likesCount: '0' },
    ]

    let postElements = postsData.map((item, index) => {
        return <Post key = {index} name = {item.name} id = {item.id} text = {item.text} likesCount = {item.likesCount}/>
    })

    return <div className={styles.blockPosts}>
        <p>Posts</p>
        <textarea name="" id="" cols="30" rows="10"></textarea>
        <button>Add</button>
        <Post name="Anar" text="Hi" likesCount = '0' />
        <Post name="Anar" text="Im good" likesCount = '0'  />
        <Post name="Anar" text="1337" likesCount = '0'  />
    </div>
}

export default Posts;
